JB23（1～3型）用オールアルミ製インテークパイプとTRUST製のブローオフバルブのセットです。<br>
これで、フルブースト時にブーストがリークしてエアクリーナーに戻りパワーダウンする、なんていうことはなくなります!!<br>
音重視のかたは大気解放に、それ以外の方はエアクリーナーに戻す配管も同梱しています。<br>
インタークーラーまでの圧損と、ホースの抜けを防止する独特の形状のインテークパイプを採用しています。<br>
